def fft2(x: n=>m=>Complex) -> n=>m=>Complex given (n|Ix, m|Ix) =
  x'      = for i. fft x[i]
  transpose for i. fft (transpose x')[i]

def ifft2(x: n=>m=>Complex) -> n=>m=>Complex given (n|Ix, m|Ix) =
  x'      = for i. ifft x[i]
  transpose for i. ifft (transpose x')[i]
